const images =[
  {img : "/images/이미지1.png" }
]

function FilterButton({ images }) {
  return (
    <div>
      {images.map((img, index) => (
        <div className="FilterButton" key={index}>
          <img className="Item_IMG_filter" src={img} alt="IMG" />
          <p>타입 종류</p>
        </div>
      ))}
    </div>
  );
}

export default FilterButton;
